import React from "react";
import Header from "./Header";

import "./App.css";

class App extends React.Component {
  render() {
    const titleHandler = () => {
      return <h1>Name It</h1>;
    };
    return (
      <div>
        <Header title={this.titleHandler} />
      </div>
    );
  }
}

export default App;
